import React from "react";
import RingImage from "../styles/bt.png";
import { Container, SignupFormContainer, Title } from "../styles/SignupStyle";

const Home = () => {

    const tabImageStyle = {
        width: '80%',
        height: '80%',
        margin: '7px',
        display: 'flex',
        justifyContent: 'center'
      };

    const handleRingImageClick = () => {
        window.location.href = "./ring";
      };
  return (
    <Container>
      <SignupFormContainer style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <Title>안녕하세요, OOO님의 오늘의</Title><Title>목표 활동량은 0%입니다.</Title>
        <img
          src={RingImage}
          alt="Ring"
          style={tabImageStyle}
          onClick={handleRingImageClick}
        />

      </SignupFormContainer>
    </Container>
  );
};

export default Home;
